  const courses = [
    {
      name: "Murugan",
      place: "Thiruchendhur",
      img: appan,
      mantra: "Om",
    },
    {
      name: "Kathirvela",
      place: "Palani",
      img: lord,
      mantra: "Saravana bhava",
    },
    {
      name: "Senthil",
      place: "Thovalai",
      img: muruga,
      mantra: "Arohara",
    }
  ];
  const Muruga= courses.map((Muruga) => <Simple name ={courses.name}place={courses.place}img={courses.img}mantra={courses.mantra} />)
  return(
     <>
     {}
     </>
  );
};

export default Muruga;
